INSERT INTO `corp_corp` VALUES ('1', 'CorpContact', 'DoctorCom - Contact', 'Contact', '', '<b>Temporary Contact Information  *please check back for updates to these data</b>\r\n\r\n<h4>In the US</h4>\r\n<p>Main Number: 650-605-3904<br/>\r\nMain Fax: 650-618-1461<br/>\r\ninfo@mdcom.com\r\n</p>\r\n\r\n<p>\r\n555 Bryant St. Suite #715<br/>\r\nPalo Alto, CA 94301\r\n</p>\r\n\r\n<h4>In Europe</h4>\r\n<p>Number: +49 1578 8489055</p>\r\n', '', 'corp_contact.html');
INSERT INTO `corp_corp` VALUES ('2', 'Overview', 'DoctorCom - Overview', 'Company Overview', '', '<p>DoctorCom is a start-up based in Palo Alto, CA, whose core technology was recently acquired from My Health, Inc. The strength of the DoctorCom platform is that it leverages the technology of partner companies with that of our own proprietary software. The net result is a suite of on-target products and services that truly addresses the communication needs of medical practices and their individual healthcare providers.\r\n</p>\r\n<p>\r\nMore information will be posted in the near future, but our CEO always welcomes direct inquiries at <a href=\"mailto:meiffert@mdcom.com\">meiffert@mdcom.com</a>.\r\n</p>', '', 'overview.html');
INSERT INTO `corp_corp` VALUES ('3', 'OurTeam', 'DoctorCom - Our Team', 'Our Team', '', '', '#outerdiv {width:938px;min-height:55em;background-color:#F5F5F5;border:1px solid darkgray;margin-top:5px;margin-left:25px;}\r\n\r\n#innerdiv {width:870px;height:90%;background-color:#FFF;color:#5F5D5D;border:1px solid lightblue;margin-top:15px;margin-left:20px;display:inline;padding:15px;float:left;font-size:.95em;}\r\n\r\n#ourteam li {clear:both;margin:10px 0px;list-style-type:none;font-size:.9em;}', 'our_team.html');
