INSERT INTO `corp_corp` VALUES ('11', 'CorpHome', 'DoctorCom', 'Welcome', '', '<p>\r\nWelcome to DoctorCom&reg;  the future of healthcare communication! I am Dr. Michael Eiffert, President and CEO of DoctorCom, Inc.  Our platform consolidates the disparate and often ineffective communication channels that healthcare professionals rely on each day into one easy-to-use application.  Whether youre in the office, hospital or clinic setting, DoctorCom keeps you connected to colleagues and office staff.\r\n</p>\r\n<p>\r\nOur first product offering, a fully automated answering service geared toward the small and mid-sized practice is coming in just a few weeks. At $49.95/month for the typical practice, DoctorCom provides an economical, but reliable and scalable answering service to meet your practice needs.  This answering service can be tailored to the unique needs of different practice models, making it perfect not just for traditional medical practices, but also for concierge, dental and allied health practices.\r\n</p>\r\n<p>\r\nOne of our staff members would welcome the opportunity to speak to you about our communication solutions for your medical practice. Please contact us at <a href=\"mailto:sales@mdcom.com\">sales@mdcom.com</a> and a representative will contact you shortly.\r\n</p>\r\n<p>\r\nOn behalf of the entire team at DoctorCom, we thank you for your interest and look forward to assisting you and your practice.\r\n</p>', '', 'login2.html');
INSERT INTO `corp_ourteam` VALUES ('1', 'Michael', 'Eiffert', 'President &amp; CEO', 'Michael is the founder of DoctorCom and is a veteran of multiple start-ups. He is board-certified in Internal Medicine and was Chief Resident at Rochester General Hospital. His areas of interest are building hospital efficiencies and healthcare communication.', '0', 'images/biopics/ME.jpg', 'Management Team', '2011-02-05 12:38:58', '1', '1');
INSERT INTO `corp_ourteam` VALUES ('2', 'Brian', 'Kim', 'Chief Technology Officer', 'Brian comes to us from ITT where he worked on projects for DOD. He is a graduate of the Univeristy of Rochester where he studied computer science with a focus on web security.', '0', 'images/biopics/BK_Photo.jpg', 'Management Team', '2011-02-05 12:42:55', '2', '1');
